verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      m_morph_list_tos ->
	  v_msg_m_morph_list_tos(Msg, [MsgName], TrUserData);
      m_morph_list_toc ->
	  v_msg_m_morph_list_toc(Msg, [MsgName], TrUserData);
      m_morph_active_tos ->
	  v_msg_m_morph_active_tos(Msg, [MsgName], TrUserData);
      m_morph_active_toc ->
	  v_msg_m_morph_active_toc(Msg, [MsgName], TrUserData);
      m_morph_upstar_tos ->
	  v_msg_m_morph_upstar_tos(Msg, [MsgName], TrUserData);
      m_morph_upstar_toc ->
	  v_msg_m_morph_upstar_toc(Msg, [MsgName], TrUserData);
      m_morph_figure_tos ->
	  v_msg_m_morph_figure_tos(Msg, [MsgName], TrUserData);
      m_morph_figure_toc ->
	  v_msg_m_morph_figure_toc(Msg, [MsgName], TrUserData);
      p_morph -> v_msg_p_morph(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


