-dialyzer({nowarn_function,v_msg_m_morph_list_tos/3}).
v_msg_m_morph_list_tos(#m_morph_list_tos{type = F1},
		       Path, TrUserData) ->
    v_type_int32(F1, [type | Path], TrUserData), ok;
v_msg_m_morph_list_tos(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, m_morph_list_tos}, X,
		  Path).

-compile({nowarn_unused_function,v_msg_m_morph_list_toc/3}).
-dialyzer({nowarn_function,v_msg_m_morph_list_toc/3}).
v_msg_m_morph_list_toc(#m_morph_list_toc{type = F1,
					 morphs = F2, used_id = F3},
		       Path, TrUserData) ->
    v_type_int32(F1, [type | Path], TrUserData),
    if is_list(F2) ->
	   _ = [v_msg_p_morph(Elem, [morphs | Path], TrUserData)
		|| Elem <- F2],
	   ok;
       true ->
	   mk_type_error({invalid_list_of, {msg, p_morph}}, F2,
			 [morphs | Path])
    end,
    v_type_int32(F3, [used_id | Path], TrUserData),
    ok;
v_msg_m_morph_list_toc(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, m_morph_list_toc}, X,
		  Path).

